description:
Island Fever 3
~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~

Relax. Take a deep breath and let Island Fever 3 transport you to a sensual world of pure, raw passion, unlike any you've ever known.Experience paradise, where you can live and breathe your every fantasy with the most exotic women the world has ever seen, Jesse Jane, Devon &amp; Tera Patrick. Revolutionary director Joone invites you to explore all your fantasies in the warm tropics of Tahiti and Bora Bora. Immerse your senses in a lush, tropical paradise as three beautiful women surround you, each existing to fulfill your ultimate fantasy. Filmed entirely on HD, the third volume in the award winning and critically acclaimed Island Fever series is presented in a special double disc collectors set with regular DVD and HD-DVD options and features Devon and Jesse's first sexual encounter.

Cast: Jesse Jane   Tera Patrick   Devon (I)   Evan Stone   Barrett Blade   Eric Masterson

